import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
require('dotenv').config()

const params = {
  URL: process.env.URL,
  PORT: process.env.PORT
}

ReactDOM.render(
  <React.StrictMode>
    {console.log('>> >> ', params)}
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

serviceWorker.unregister();
